import'./Body.css'
import './Navigation.css';
function Body(){
  return(
    <div className='box3'>WELCOME TO MY LIFE
    <div className='box2'>PHOTOOO AAYEGI NA IDHR</div>
    <div className='nav'>
        <ul>
          <li><a href="#home">Home</a></li>
          <li><a href="#event">Event</a></li>
          <li><a href="media">Media</a></li>
          <li><a href="#about us">About us</a></li>
          <div className='button nav'><a href="#login">Log in</a></div>
        </ul>
      </div>
    
    </div>
  );
}      export default Body;
